import React from 'react';
import Container from '@material-ui/core/Container';

const PrintQuote = (props) => {
   console.log(props);
    return (
        <div className="printQuote">
            <Container maxWidth="sm"  style={{ backgroundColor: '#cfe8fc', height: 'auto' }} >
                <h1>{props.quotes.text}</h1>
                <p>{props.quotes.author}</p>
                <a href={'https://twitter.com/intent/tweet?text=' + props.quotes.text + ' - ' + props.quotes.author} target="_blank" className="btn btn-primary btn-block">Tweet<i className="fa fa-fw fa-twitter"></i></a>
            </Container>
        </div>
    )
}

export default PrintQuote;
